(1, 0, 1324583617, '', 'daroPL_AntiSpam', 'MOD blocks spambot registrations and posting on board via change name of confirm code field to unique hash. In addition, changes field size to random.', '1.4.1', 'No Author Notes were specified.', 'daroPL', 'edaroo@gmail.com', 'http://www.phpbb.pl', 'a:3:{s:3:\"SQL\";a:0:{}s:5:\"EDITS\";a:2:{s:45:\"includes/captcha/plugins/captcha_abstract.php\";a:4:{i:0;a:1:{s:27:\"	var $captcha_vars = false;\";a:1:{s:9:\"after add\";s:52:\"	var $daropl_fieldname;\\n	var $daropl_fieldname_hash;\";}}i:1;a:1:{s:56:\"		$this->confirm_code = request_var(\'confirm_code\', \'\');\";a:1:{s:12:\"replace-with\";s:233:\"		$this->daropl_fieldname = sha1(time() . rand());\\n		$this->daropl_fieldname_hash = request_var(sha1($config[\'cookie_name\'] . $config[\'record_online_date\']), \'\');\\n		$this->confirm_code = request_var($this->daropl_fieldname_hash, \'\');\";}}i:2;a:1:{s:38:\"				\'L_CONFIRM_EXPLAIN\'			=> $explain,\";a:1:{s:9:\"after add\";s:183:\"				\'S_DAROPL_FIELDNAME\'		=> $this->daropl_fieldname,\\n				\'S_DAROPL_SALT\'				=> sha1($config[\'cookie_name\'] . $config[\'record_online_date\']),\\n				\'S_DAROPL_FIELDSIZE\'		=> rand(8, 20),\";}}i:3;a:1:{s:51:\"		$hidden_fields[\'confirm_id\'] = $this->confirm_id;\";a:1:{s:9:\"after add\";s:123:\"		global $config;\\n		$hidden_fields[sha1($config[\'cookie_name\'] . $config[\'record_online_date\'])] = $this->daropl_fieldname;\";}}}s:46:\"styles/prosilver/template/captcha_default.html\";a:3:{i:0;a:1:{s:62:\"		<dt><label for=\"confirm_code\">{L_CONFIRM_CODE}:</label></dt>\";a:1:{s:12:\"replace-with\";s:68:\"<dt><label for=\"{S_DAROPL_FIELDNAME}\">{L_CONFIRM_CODE}:</label></dt>\";}}i:1;a:1:{s:169:\"		<dd><input type=\"text\" name=\"confirm_code\" id=\"confirm_code\" size=\"8\" maxlength=\"8\" tabindex=\"{$CAPTCHA_TAB_INDEX}\" class=\"inputbox narrow\" title=\"{L_CONFIRM_CODE}\" />\";a:1:{s:12:\"replace-with\";s:202:\"<dd><input type=\"text\" name=\"{S_DAROPL_FIELDNAME}\" id=\"{S_DAROPL_FIELDNAME}\" size=\"{S_DAROPL_FIELDSIZE}\" maxlength=\"8\" tabindex=\"{$CAPTCHA_TAB_INDEX}\" class=\"inputbox narrow\" title=\"{L_CONFIRM_CODE}\" />\";}}i:2;a:1:{s:85:\"		<input type=\"hidden\" name=\"confirm_id\" id=\"confirm_id\" value=\"{CONFIRM_ID}\" /></dd>\";a:1:{s:9:\"after add\";s:96:\"<input type=\"hidden\" name=\"{S_DAROPL_SALT}\" id=\"{S_DAROPL_SALT}\" value=\"{S_DAROPL_FIELDNAME}\" />\";}}}}s:16:\"DIY_INSTRUCTIONS\";a:1:{i:0;s:36:\"Make sure to refresh your templates.\";}}', '', '', './../store/mods/daropl_antispam_1_4_1/install.xml');
