(6776, 964, 0, 1, 0, '192.168.10.131', 1464178910, 1, 0, 1, 1, 1, 1, 'Гость', 'Образцы SOUNDBOARD', 'Всем Доброго дня!\\nСообщаю о наличии на складе Домодедово образцов Soundboard (в двух типах - fine и superfine)\\nПрошу все подразделения с ближайшей отгрузкой переместить образцы на склады. \\n\\n[attachment=0:s7wngq5w]<!-- ia0 -->IMG_1110.JPG<!-- ia0 -->[/attachment:s7wngq5w][attachment=1:s7wngq5w]<!-- ia1 -->IMG_1111.JPG<!-- ia1 -->[/attachment:s7wngq5w]\\n\\n\\nСпасибо.', '1b689d21f0f2dd05a9f7d568ea3d6712', 1, 'AAg=', 's7wngq5w', 1, 0, '', 0, 0, 0);
INSERT INTO `phpbb_privmsgs` (`msg_id`, `root_level`, `author_id`, `icon_id`, `author_ip`, `message_time`, `enable_bbcode`, `enable_smilies`, `enable_magic_url`, `enable_sig`, `message_subject`, `message_text`, `message_edit_reason`, `message_edit_user`, `message_attachment`, `bbcode_bitfield`, `bbcode_uid`, `message_edit_time`, `message_edit_count`, `to_address`, `bcc_address`, `message_reported`) VALUES
(2, 0, 1, 0, '213.33.173.99', 1284015422, 1, 1, 1, 0, 'орг. вопрос', 'Саш, привет! В продолжение нашего вчерашнего разговора, высылаю принтскрин с моего форума. Речь шла о столбце &quot;последнее посещение&quot;. Если надо, проконсультируюсь у своего админа как его активизировать.', '', 0, 1, 'AQ==', '3t0e9xw9', 0, 0, 'u_2', '', 0),
(4, 0, 1, 0, '77.52.69.56', 1285404212, 1, 1, 1, 1, 'Список тем', 'Игорь, предлагаю повестку дня вести в одном сообщении, путем его редактирования при добавления темы. т.е. если Алферов начал тему, то твой вопрос следует добавить в его, как и все прочие.', '', 0, 0, 'AQ==', 'l5qlmy3k', 0, 0, 'u_15', '', 0),
(5, 0, 1, 0, '77.52.69.56', 1285404436, 1, 1, 1, 1, 'ПО формату ведения переписки в Интранете', 'Лена, Добрый день!\\r\\nЯ не знаю, что за личностные отношения у вас с Каневым по поводу работы в 1С, но должен заметить что его вопрос по существу имееет смысл. А именно, что значит кореектный выход? просто выход, выход с сохранением, выход с обрушением? Такие вещи следует разъяснять, потолму что если речь идет о штрафах, люди должны четко понимать что КОНКРЕТНО от них требуют.', '', 0, 0, 'AQ==', '1ovrfuso', 0, 0, 'u_56', '', 0),
(6, 0, 1, 0, '77.52.69.56', 1285404212, 1, 1, 1, 1, 'Список тем', 'Игорь, предлагаю повестку дня вести в одном сообщении, путем его редактирования при добавления темы. т.е. если Алферов начал тему, то твой вопрос следует добавить в его, как и все прочие.', '', 0, 0, 'AQ==', '19apr0ej', 0, 0, 'u_15', '', 0),
(7, 0, 1, 0, '212.15.101.33', 1285408434, 1, 0, 1, 0, 'Re: Список тем', 'понял', '', 0, 0, 'AQ==', 'oiiz4pn3', 0, 0, 'u_2', '', 0),
(8, 0, 1, 0, '212.15.101.33', 1285408434, 1, 0, 1, 0, 'Re: Список тем', 'понял', '', 0, 0, 'AQ==', 'oiiz4pn3', 0, 0, 'u_2', '', 0),
(9, 0, 1, 0, '188.123.240.145', 1287259288, 1, 1, 1, 1, 'Минская отчетность', 'А актуальность, Игорь, в том, что похоже никто с тем что происходит в Белоруссии мышей не ловит. И мне не хотелось, чтобы в итоге получилось как со смирновым, когда мы получили что-то от него ИСКЛЮЧИТЕЛЬНО исходя из его доброй воли.', '', 0, 0, 'AQ==', '3tun29si', 0, 0, 'u_15', '', 0),
(10, 0, 1, 0, '188.123.240.145', 1287259288, 1, 1, 1, 1, 'Минская отчетность', 'А актуальность, Игорь, в том, что похоже никто с тем что происходит в Белоруссии мышей не ловит. И мне не хотелось, чтобы в итоге получилось как со смирновым, когда мы получили что-то от него ИСКЛЮЧИТЕЛЬНО исходя из его доброй воли.', '', 0, 0, 'AQ==', '3tun29si', 0, 0, 'u_15', '', 0),
(11, 0, 1, 0, '212.15.101.33', 1287329620, 1, 0, 1, 0, 'Re: Минская отчетность', 'ну и к чему этот пассаж от тебя? какое это имеетм отношение к совещанию?', '', 0, 0, 'AQ==', 'k78nsxlj', 0, 0, 'u_2', '', 0),
