(158, 0, 1, 10, '86.62.115.133', 1342601630, 1, 1, 1, 1, 'Заполнение личных контактов', 'Добрый день коллеги!\\nНапоминаю Вам что до[b:37flfb40] 20 июля[/b:37flfb40] Вам необходимо заполнить свои контактные данные в профиле интранета.\\nЕсли у Вас возникнут трудности или вопросы по заполнению, обратитесь к сотрудникам своего отдела (которые уже все добавили необходимые данные и знают как это сделать по инструкции). В том случае если они не смогут Вам помочь, обращайтесь ко мне по тел. 8-903-271-36-36 (Женя) или в скайп.\\n\\nСпасибо! <!-- s:D --><img src=\"{SMILIES_PATH}/icon_biggrin.gif\" alt=\":D\" title=\"Very Happy\" /><!-- s:D -->', '', 0, 0, 'QA==', '37flfb40', 0, 0, 'u_70:u_35:u_50:u_34:u_56:u_52:u_5859:u_5856:u_5858:u_59:u_5848:u_5854:u_5853:u_46', '', 0),
(159, 0, 1, 0, '194.84.118.53', 1344236230, 1, 1, 1, 1, 'пароль', '[10:51:25] Руслан: привет, пароль к личной карточке в 1С для меня и Юлии вышли пжста...\\n[10:52:01] Геннадий Баев: это делает программист, нужно отправить личное сообщение через интранет', '', 0, 0, '', '33oyqfvq', 0, 0, 'u_5849', '', 0),
(160, 159, 1, 0, '86.62.115.133', 1344243752, 1, 1, 1, 1, 'Re: пароль', 'добрый день. я не программист. обращайтесь к Киселеву Сергею', '', 0, 0, '', '6sghcj72', 0, 0, 'u_5858', '', 0),
(161, 0, 1, 0, '194.84.118.53', 1344244421, 1, 1, 1, 1, 'пароль', '[10:51:25] Руслан: привет, пароль к личной карточке в 1С для меня и Юлии вышли пжста...\\n[10:52:01] Геннадий Баев: это делает программист, нужно отправить личное сообщение через интранет\\n\\nВот... Юлия - это Юлия Воробьева, новый менеджер нашего отдела', '', 0, 0, '', '3ix8y1nf', 0, 0, 'u_87', '', 0),
(162, 0, 5883, 9, '86.62.115.133', 1357715926, 1, 1, 1, 1, 'по 1c', 'Сергей, привет. Я вновь принятый в Акустику - переведенный из Декотека. Мне нужен доступ в 1с Акустики. Как скоро сделать сможешь?  (логин и пароль)', '', 0, 0, '', '3xu46d6o', 0, 0, 'u_87', '', 0),
(163, 162, 1, 9, '77.236.239.146', 1357717368, 1, 1, 1, 1, 'Re: по 1c', 'Напиши мне в скайпе', '', 0, 0, '', '2w9rlil8', 0, 0, 'u_5883', '', 0),
(164, 0, 1, 0, '86.62.115.133', 1359095166, 1, 1, 0, 0, 'Вам вынесено предупреждение', 'Это предупреждение, вынесенное вам администратором или модератором этого сайта.[quote:syh8q900]Это предупреждение, относящееся к следующему вашему сообщению: <!-- l --><a class=\"postlink-local\" href=\"http://www.intranet.acoustic.ru/viewtopic.php?f=4&amp;p=5557#p5557\">viewtopic.php?f=4&amp;p=5557#p5557</a><!-- l -->.[/quote:syh8q900]', '', 0, 0, 'gA==', 'syh8q900', 0, 0, 'u_5870', '', 0),
(165, 0, 1, 0, '213.227.195.83', 1359112024, 1, 1, 1, 1, 'по поводу предупреждения', 'Женя, здравствуй!\\nМой пост почему-то оказался некорректным? А то не пойму за что предупреждение от модератора.', '', 0, 0, '', '2as4avyq', 0, 0, 'u_48', '', 0),
(166, 165, 1, 0, '86.62.115.133', 1359114085, 1, 1, 1, 1, 'Re: по поводу предупреждения', 'Привет Руслан. \\nЯ удалила твое сообщение т.к. оно не относилось к данной теме и к акустике не имело отношения.', '', 0, 0, '', 'gzbk4p8k', 0, 0, 'u_5870', '', 0),
(167, 0, 1, 0, '85.235.206.250', 1375262455, 1, 1, 1, 1, 'Re: Договора с клиентами', '[url=http&#58;//intranet&#46;acoustic&#46;ru/viewtopic&#46;php?p=5811#p5811:v43wrcje]Заголовок: Договора с клиентами[/url:v43wrcje]\\n\\n[quote=&quot;Баев Геннадий&quot;:v43wrcje]Коллеги, необходимо заключать договора с клиентами:\\n\\n1. При сумме более 500 000 руб. Строго!!!\\n2. При нашей доставке на объект. Строго!!!\\n3. При любом изменении в стандартном договоре. Строго!!!\\n4. Во всех других случаях - желательно.\\n\\nВсе договора иметь сканированную копию в папке Z:\\ДОГОВОРЫ отдела продаж\\Договора 2013, при получении оригинала в 1С.\\n\\nГеннадий.[/quote:v43wrcje]\\n\\nРаньше было от 300 000 !!! рамки расширили?', '', 0, 0, 'kA==', 'v43wrcje', 0, 0, 'u_28', '', 0),
(168, 0, 1, 1, '86.62.115.133', 1383051425, 1, 1, 1, 1, 'ДОБАВЛЕНИЕ ФОТО В ПРОФИЛЕ ИНТАРНЕТА', 'Коллеги! \\nПрошу добавить свое фото в профиле интранета! \\nСделать это не сложно: зайдите в свой личный раздел (слева сверху) и выберите раздел &quot;профиль&quot; далее &quot;аватара&quot; и загрузите свою фотографию.\\nЕсли у Вас возникнут проблемы с загрузкой фото - обращайтесь ко мне (скайп, почта, телефон у Вас думаю есть)\\n\\nОсобенно это касается новых сотрудников!!!!\\n\\nЗаранее всем спасибо!', '', 0, 0, '', '2ghdyt1r', 0, 0, 'u_5911:u_5896:u_5913:u_5890:u_5908:u_5904:u_5891:u_5906:u_5905:u_5907:u_5870:u_5912:u_5909', '', 0),
(169, 0, 1, 0, '86.57.193.30', 1405513136, 1, 1, 1, 1, 'офис Минск', 'Людмила,день добрый!\\nЯ Ваш новый сотрудник в офисе (г.Минск)Наталья <!-- s:) --><img src=\"{SMILIES_PATH}/icon_smile.gif\" alt=\":)\" title=\"Smile\" /><!-- s:) -->  \\nГеннадий подсказал,что Вы занимаетесь канцелярскими товарами.Как нам сделать заявку?или нам самим все покупать?', '', 0, 0, '', '28y9t06b', 0, 0, 'u_58', '', 0),
(170, 0, 1, 0, '46.21.67.17', 1409637548, 1, 1, 1, 1, 'Re: Видеоинструкция по монтажу ЗИ перегородки', 'Красавцы, качественно, красиво и доступно снимаете.', '', 0, 0, '', '206pd3zt', 0, 0, 'u_82', '', 0),
(171, 170, 1, 0, '217.10.42.96', 1409657761, 1, 1, 1, 1, 'Re: Видеоинструкция по монтажу ЗИ перегородки', 'Спасибо! стараемся)', '', 0, 0, '', '21j6cjru', 0, 0, 'u_5869', '', 0),
(172, 0, 1, 7, '85.235.206.250', 1422437889, 1, 1, 1, 1, 'Re: Пожарные испытания ЭхоКор', '[url=http&#58;//intranet&#46;acoustic-group&#46;net/viewtopic&#46;php?p=6437#p6437:1cscbxun]Заголовок: Пожарные испытания ЭхоКор[/url:1cscbxun]\\n\\n[quote=&quot;Родин Антон&quot;:1cscbxun]Материал относится к классу пожарной опасности [b:1cscbxun]КМ3[/b:1cscbxun][/quote:1cscbxun]\\nвообще по испытаниям Г2 - ну совсем натянутое <!-- s;-) --><img src=\"{SMILIES_PATH}/icon_wink.gif\" alt=\";-)\" title=\"Wink\" /><!-- s;-) -->', '', 0, 0, '0A==', '1cscbxun', 0, 0, 'u_21', '', 0),
(173, 172, 1, 7, '192.168.10.146', 1422439384, 1, 1, 1, 1, 'Re: Пожарные испытания ЭхоКор', 'ага. Лаборатория сказала, что если попробовать еще померить, то можно натянуть на Г1. Игорь сказал не надо!!!', '', 0, 0, '', '1u7s38a1', 0, 0, 'u_84', '', 0);
