INSERT INTO `phpbb_rights` (`id`, `name`, `description`) VALUES
(2, 'hr_manager', 'HR-менеджерам доступны все графики работ. А также просмотр соответствующих сведений в карточках работников.'),
(3, 'delete_right', ''),
(4, 'add_right', ''),
(5, 'show_rights', 'Наличие ссылки \"Настройка прав\" в \"Панели администратора\"'),
(6, 'show_admin_panel', 'Наличие ссылки \"Панель администратора\" в главном меню'),
(7, 'show_timetable', 'Наличие ссылки \"Графики работ\" в главном меню'),
(8, 'show_hidden_contacts', 'Позволяет просматривать скрытые контакты в разделе \"Сотрудники\". Обычно скрытые контакты используются для формирования графиков работ для сотрудников, которые не должны быть видны здесь.'),
(9, 'edit_contact', 'Позволяет редактировать карточку сотрудника'),
(10, 'add_contact', ''),
(11, 'delete_contact', ''),
(12, 'add_point', ''),
(13, 'delete_point', ''),
(14, 'edit_point', ''),
(15, 'add_branch', ''),
(16, 'edit_branch', ''),
(17, 'delete_branch', ''),
(18, 'timetable_menu_tablica', 'Изменяет поведение ссылки \"Графики работ\". Без этого права ссылка ведет в раздел \"Отчет\", а раздел \"Таблица\" недоступен. С этим правом ссылка ведет в раздел \"Таблица\" при этом раздел \"Отчет\" остается доступным.'),
(19, 'timetable_show_all', 'Позволяет видеть всех пользователей в разделах \"Графики работ\". В отличие от редакторов, которые видят только пользователей, доступ на управление графиками которыми у них есть.'),
(20, 'timetable_bez_redactora', 'В \"Графиках работ\" в фильтре \"Редактор\" добавляет пункт \"--без редактора--\", т.е. позволяет отображать отдельно список пользователей, для которых не указан редактор.'),
(21, 'timetable_show_all_first', 'При входе в \"Графики работ\" позволяет по умолчанию показывать список всех сотрудников, даже если текущий пользователь является редактором. Актуально для пользователей одновременно являющихся редактором и обладающих правами timetable_show_all.'),
(23, 'show_stat', 'Позволяет просматривать статистику и отвечает за наличие ссылки \"Статистика\" в \"Панели администратора\"'),
(24, 'edit_previous_month_timetables', 'Позволяет редактировать графики работ за предыдущие месяца');
